import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import logo from './logo.png';

function App() {
  return (
  <nav>
    <Link to="/"><img src={logo} width="80px" alt='logo'/></Link>
    <Link to="/about">О нас</Link>
    <Link to="">Статьи</Link>
    <Link to="">Аниматоры</Link>
    <Link to="">Шоу-программы и квесты</Link>
    <Link to=""></Link>
    <Link to=""></Link>
  </nav>
  );
}

export default App;
